import React, { Component } from "react";
import Nav from "../Nav";

class Portfolio extends Component {
    render() {
        const divStyle = {
            color: "black",
            border: "2px white solid",
            borderRadius: "10px",
            background: "#ffffff80",
            fontFamily: "Arial, Helvetica, sans-serif",
            width: "50%",
            margin: "0 auto",
            display: "block",
            padding: "10px"
        }

        const titleStyle = {
            fontSize: "1.2rem",
            borderBottom: "1px black solid",
            width: "70%",
            marginBottom: "10px"
        }

        return(
            <div>
                <Nav />
                <div style={divStyle}>

                </div>
            </div>
        )
    }
}

export default Portfolio;
